     The IANA policy (using terms defined in [RFC5226]) for all extensions
     is Specification Required, Expert Review, or First Come First Served
     as documented in the following subsections.  Registrations submitted
     to IANA are forwarded to the IPP Designated Expert(s) who reviews the
     proposal on a mailing list that the Designated Expert(s) keeps for
     this purpose.  Initially, that list is the mailing list used by the
     PWG IPP WG:
"fixed": |-
  The IANA policy (using terms defined in [RFC5226]) for all extensions is Specification Required, Expert Review, or First Come First Served as documented in the following subsections.  Registrations submitted to IANA are forwarded to the IPP Designated Expert(s) who reviews the proposal on a mailing list that the Designated Expert(s) keeps for this purpose.  Initially, that list is the mailing list used by the PWG IPP WG:
"ko": |-
  모든 확장에 대한 IANA 정책([RFC5226]에 정의된 용어 사용)은 다음 하위 섹션에 설명된 대로 사양 필요, 전문가 검토 또는 선착순입니다. IANA에 제출된 등록은 지정 전문가가 이 목적을 위해 보관하는 메일링 목록의 제안을 검토하는 IPP 지정 전문가에게 전달됩니다. 처음에 해당 목록은 PWG IPP WG에서 사용하는 메일링 목록입니다.
